  static final String playerInfo = jsonEncode({
    "id": "576",
    "bat": "Right Handed Bat",
    "bowl": "Right-arm offbreak",
    "name": "Rohit Sharma",
    "nickName": "Rohit",
    "role": "Batsman",
    "birthPlace": "Nagpur, Maharashtra",
    "intlTeam": "India",
    "teams":
        "India, Deccan Chargers, India A, India Green, India U19, Mumbai, Mumbai Indians, Indians, India Blue, Board Presidents XI",
    "DoB": "April 30, 1987 (38 years)",
    "image": "http://i.cricketcb.com/stats/img/faceImages/576.jpg",
    "bio":
        "Talent  an apparently heartening term that has followed Rohit Sharma around like a shadow; even haunted him at times. It seems to be a burden that the cricketing fraternity has enforced upon him and, after more than a decade in the national setting, he has been weighed down by the label.  <br/>  <br/> Harsha Bhogle spoke of whispers in the domestic circuit; of coaches and scouts spotting the effortless, free-flowing stroke-play of a Mumbai teenager. Having cruised through first-class cricket, with an average well above 50, he shot to the limelight when he scored a brisk unbeaten triple-hundred at the Ranji level. <br/>  <br/> It all began after an injury to an in-form Yuvraj Singh in the 2007 World T20, when Rohit was called upon as a last-minute emergency replacement to play a league game against the hosts. After a lacklustre start to the Indian innings, the 20-year-old strode out into Kingsmead and stroked his way to a fluent half-century against the likes of Pollock, Ntini and Morkel as though he were having a net session. He showed startling maturity under pressure to survive till the end of the innings, escorting India to a respectable total that they ultimately defended, knocking South Africa out of the tournament in their own backyard. <br/>  <br/> Indian cricket-frenzy fans have a thing for like-for-like replacements. More specifically, they have a thing for spotting similarities with the days gone by. With an incessant obsession for stats, there lies a cricketing romantic who is struck by nostalgia when manifested with the idea of an elegant-looking batsman with free-flowing batting style from Mumbai. That's right  Rohit Sharma was touted to be the Great Sachin Tendulkar's long-destined successor at number 4 in the Test batting line-up. After all, it added up: so much time to play his shots, effortless stroke-making capabilities even against express pace, and a wide repertoire of shots. This had to be God's gift to cricket in the post-Tendulkar era, right? <br/>  <br/> Rohit was subsequently picked for the ODI team on a selection whim after his burst of vital performances in the World T20 and his impressive Ranji Trophy record. He made an impression in the CB series Down Under, playing some crucial cameos against stalwarts like Brett Lee and Stuart Clark, and a more-than-competent Sri Lankan attack. These inspired away performances in the World T20 and the CB series caught the eye of the selectors, and warranted him an extended run with the limited-overs side. <br/>  <br/> However, inconsistency and a knack of gifting his wicket away meant that he struggled to cement his spot in the side. Critics pointed out that he had too many shots for the same ball, and this meant that shot selection was becoming a bit of an issue for him. Furthermore, several experts spotted that he had trouble playing the short ball since his stance was too side-on and that he had no back-and-across trigger movement. His pedestrian batting average of 22 to go with a string of low scores and unconverted starts meant that he failed to cement a spot in the side for the 2011 Cricket World Cup squad...  <br/>  <br/> Looking back at his career, Rohit Sharma would have the Indian Premier League to thank for keeping him in the reckoning and not being discarded liked several other young and talented cricketers who burst forth into national reckoning but couldn't make it big at the highest level. In the first two years of the IPL, his performance stood out, as he made over 350 runs each time for the Deccan Chargers and proved his worth to his franchise. He was then transferred to the Mumbai Indians franchise in 2011 and has been one of their most consistent batsmen over the years. <br/>  <br/> Rohit continued to oscillate in and out of the Indian eleven without being able to establish himself in the side, having been given ample opportunities despite a well-established Indian middle-order. Alas, after making it to the Playing XI for the Nagpur Test against South Africa in 2010, he was lamentably injured in a warm-up football game after coming heart-breakingly close to receiving the coveted India cap. He was subsequently ruled out of the series in a gut-wrenching turn of events, and wouldn't get another opportunity to prove his Test credentials for another 4 years. <br/>  <br/> Rohit's proved himself on the IPL stage again in 2011 and made a comeback into the ODI squad for the tour of West Indies where he scored three half-centuries in five matches. However, this turned out to be another false dawn as he followed it up with a string of low scores in the CB series in Australia and a nightmare tour of Sri Lanka with just 14 runs from 5 innings, including 2 ducks. He had already been given a more-than-extended run and was starting to build an unenviable reputation of a frustratingly fascinating player.  <br/>  <br/> The generally fickle selectors, surprisingly, continued to back him. Eventually, due to lack of contenders for the opener's spot in ODIs, MS Dhoni, the Indian captain, decided to try him as an opener in the limited-overs' format.  <br/>  <br/> The term 'masterstroke' has always been a bit of an enigma, historically being used in a vague, result-based manner. The move to promote Rohit Sharma to the top of the order has paid enough dividends for it to be termed a masterstroke  India had finally found a candidate for the opener's spot, and Rohit seemed to have finally scripted a turnaround after almost 5 years in and out of the side. With enough time to play himself in as an opener, Rohit and Dhawan formed a formidable opening partnership, playing a substantial role in India's unbeaten and successful Champions' Trophy campaign in 2013. Still, the talented tag followed him around, and Rohit  at long last  started to live up to it. In a run-fest of an ODI series against Australia, Rohit scored 491 runs in 6 outings, culminating in a violent 209 in the deciding ODI in Bangalore, joining a crme de la crme list of ODI double-centurions that comprised of Sachin Tendulkar and Virender Sehwag. <br/>  <br/> With the retirements of stalwarts like Rahul Dravid and VVS Laxman, a new crop of Test batsmen needed to be honed, and opened up new avenues in the team. Rohit, at long last, earned the oh-so-desirable India Test cap against West Indies in the first Test at the Eden Gardens in his fabled 'predecessor's' farewell series. Rohit wasn't going to let this opportunity go begging and embraced the Test arena immediately, easing his way to a typically Rohit-esque 177 in his debut innings; a vital innings in the context of the match, dragging the momentum India's way. He reinforced his metaphorical statement to the selectors with an unbeaten 111 in the following Test, enchanting a tearful Wankhede in Sachin Tendulkar's farewell Test match and taming the West Indian bowling attack. After an injury-break, Rohit, as if to make up for lost time, ripped apart a hapless Sri Lankan attack on his way to a jaw-dropping 264  wait for it  <i>in an ODI</i> at the Eden Gardens, making thirteen runs more than the entire Lankan team managed.  <br/>  <br/> However, a worrying trend continued after the selectors picked him for the tour to Australia after his Kolkata epic: that of getting picked for away Test tours based on white ball performances in less testing conditions. He was picked after his 209 for the South Africa tour in late 2013 and looked technically inept in seaming conditions, committing to the line of the ball too early and playing as if it were a true wicket. His strength of picking the length early in ODIs was turning into a curse in Test matches. Similarly, having been picked for the tour of Australia on the back of his 264, he made just one fifty in 6 innings, looking completely at sea against the pace-heavy Australian attack, continuously playing away from the body, trying to hit through the line in conditions conducive to lateral movement and showing poor off-stump awareness.  <br/>  <br/> Nevertheless he continued his golden run in ODIs, ending the 2015 World Cup campaign as India's second-highest run-scorer with a total of 330 runs, including a hundred in the quarter-final against Bangladesh to go with two fifties. <br/>  <br/> Rohit, the ODI player, finally delivered a break-through performance as an opener with an impeccable limited-overs tour of Australia in early 2016, making back-to-back hundreds and a 99 in the series and finally answering the faith of the selectors and his captain. He had become a one-day monster who developed a habit - started his ODI innings in a slow and steady manner, but could really lay into any bowling attack once he was in. With an extended home season, Rohit continued to get chances in Tests and showed vast improvement in his technique, playing closer to his body and preventing his ODI game to amalgamate with his more air-tight Test technique. With four fifties and a hundred in his last 5 innings, he capped off a fruitful home season with an unprecedented third ODI double-century against a woebegone Sri Lankan attack.  <br/>  <br/> With gifted technique and languid elegance as his allies, Rohit found a route to consistency and has been a regular feature in the Test set-up since 2018. His white-ball, prowess, however witnessed yet another high in 2019 as he ended up as the highest run-getter in the ODI World Cup in England with 648 runs from 9 games at an average of 81 that included 67 fours and 14 sixes. Just over a month ahead of the 2021 T20 World Cup, Virat Kohli stepped down as T20I captain, and there were no qualms about who the next skipper was going to be, with Rohit Sharma being the ultimate favourite. A couple of months later, BCCI named Rohit as the ODI skipper for the tour of South Africa 2021-22. Having missed the entire tour due to injury, Rohit assumed the full-time captaincy in India's 1000th ODI in Ahmedabad (vs West Indies on 06 February 2022). A couple of weeks later, and on expected lines, Rohit took over the Test captaincy from Kohli and led India to series wins over Sri Lanka and Bangladesh (drew series with England in England 2021-22) thus far (As of March 2023). <br/>  <br/> Rohit was Indias skipper in the 2022 T20I World Cup, where his team was brutally outplayed by England in the semi-final. Post that defeat, he took the mantle on himself to change the team culture and instill a brand of fearless cricket amongst his boys. Rohit led from the front in the 2023 ODI World Cup, giving the team blazing starts in most games. He scored quick runs without caring too much for personal records as India cruised through to the finals, unbeaten. They were unfortunately beaten in the final by Australia. <br/>  <br/> Rohit Sharma got his chance at redemption though a few months later in the T20I World Cup. He was instrumental for India in a group game against Australia and then in the semi-final against England where he scored big runs to drive the opposition out of the game. It was under his captaincy that India eventually managed to break their 11 year trophy jinx as they won the 2024 T20I World Cup in Barbados. Rohit Sharma subsequently retired from T20Is after winning the World Cup. Post the World Cup, Rohit had a bit of a slump in form, especially in Test cricket as India suffered a 3-0 home whitewash at the hands of New Zealand and then lost the Border Gavaskar Series as well. He famously dropped himself from the side despite being skipper for the final Sydney Test of the BGT. <br/>  <br/> Rohit found form once again when white ball cricket resumed, as he scored a superb hundred against England in a home bilateral series. He followed that form into the Champions Trophy, reserving his best for the final where he top scored for India to claim the Man of the Match and also lead the team to a second ICC trophy in the span of nine months. <br/>  <br/> In April, 2025, while still the captain of the Test team, Rohit Sharma announced his retirement from Test cricket, drawing the curtains on a career that spanned 12 years.      <br/>  <br/>  <br/> <b>IPL through the years</b> <br/>  <br/> The IPL has done a lot for Rohit Sharma. When he was a young, talented batsman who struggled with consistency, the IPL gave him a ticket to stay relevant, and he grabbed it with both hands during his time with the Deccan Chargers from 2008-2010, scoring over 350 runs in each of the three seasons. Then the IPL took him back to his home of Mumbai, and Rohit couldn't have been happier. His statistics with the Mumbai Indians got progressively better from 2011-13, and eventually his best IPL season in 2013 - where he finished the tournament with 538 runs - coincided with MI's maiden title win.  <br/>  <br/> And finally, the IPL helped unveil a leadership side to Rohit Sharma that has impressed a lot of people. Rohit led MI to five IPL titles which is an amazing accomplishment.  Rohit is also among the all-time top run-scorers in the IPL, only behind Virat Kohli and Shikhar Dhawan. <br/>  <br/> In 2024, Rohit was removed as captain by Mumbai Indians with a returning Hardik Pandya taking over captaincy after being transferred in from Gujarat Titans. Rohit Sharma was retained by the franchise ahead of the mega auction for IPL 2025.  <br/>  <br/> By <b>Rishi Roy</b> and <b>Saurabh Shankar</b>",
